import getLocationHierarchy from "./getLocationHierarchy"
import renderIndexMenu from './renderIndexMenu';
import ListItem from "./listItem"

export default function ItemList(props) {
  const getList = (list) => {
    let container = []

    for (let i = 0; i < props.pageNumber; i++) {
      if (!list[i]) break
      container.push(list[i])
    }
    return container
  }

  const getLink = (item, list) => {
    if (!props.link) return ""
    else return getLocationHierarchy(item[0].data, list)
  }

  const renderList = (list) => {
    return getList(list).map((item, i) => (
      <a
        href={getLink(item, list)}
        style={{textDecoration: "none", color: "inherit"}}
        >
        <ListItem 
          key={`${props.profile}${i}D`} 
          item1={item[0].data} 
          item2={item[1].data} 
          item3={item[2].data} 
          item4={item[3].data} 
          item5={item[4].data} 
          item6={item[5].data}
        />
      </a>
    ))
  }

  return Object.keys(props.temp).map((item, i) => (
    <div>
      {renderIndexMenu(props.data, props.item, props.filteredSearch, item)}
      {renderList(props.temp[item])}
    </div>
  ))
}
